- input: "TEXT\x1CC00161810\x1CTEXT-00001\x1C\x1CF3XN\x1CDetermination of usual and
    normal charges for Enhanced Online Voter File Access for payments received on
    Schedule A, Line 17 of the Committees report was calculated by the total cost
    of developing and hosting our online voter file and dividing it by the number
    of records within the file as well as the presumed number of overall users.  The
    cost to the organization is then determined by the number of records requested
    and the length of time access will be granted.  i.e. Statewide or congressional
    charges are based on the number of records in the district or entire state as
    requested.  -  Please note that employees of the Committee that spent less than
    25% of their time on Federal Election Activity were paid on the Schedule H4 uniform
    split. -  The Memo Schedule A's that itemize the committees share of the gross
    contributions received through the joint fundraising activities from the ASDC
    Partnership Program (Association of State Democratic Chairs), Committee for Change
    and the Democratic National Committee State Party Victory Fund are provided on
    a quarterly basis.    The transfer of the joint fundraising proceeds received
    during this reporting period from the ASDC Partnership, DNC Battleground Fund,
    Committee for Change and Democratic National Committee State Party Victory Fund,
    and ASDC Victory Joint Fundraiser programs represents the committee's share of
    proceeds for contributions received during this or prior reporting periods. The
    memo entries for these contributions are included in this or a prior report of
    the committee.  -  Transfers in from the Democratic National Committee, the Democratic
    Congressional Campaign Committee and the Democratic Senatorial Campaign Committee
    were not used as the Federal component of expenditures or disbursements that were
    used for federal election activities paid for in any part by Levin funds.  The
    committee utilizes standard accounting procedures and a detailed chart of accounts
    as well as separate bank accounts for transfer down funds to ensure that funds
    transferred from national state district and local party committees are used in
    compliance with the CFR."
